describe("Element Data Attributes Tests",function(){var a;it("reads the 'data-slider-min' property and sets it on slider",function(){a=$("#minSlider").slider();a.slider("setValue",1);var b=a.slider("getValue");expect(b).toBe(5)});it("reads the 'data-slider-max' property and sets it on slider",function(){a=$("#maxSlider").slider();a.slider("setValue",10);var b=a.slider("getValue");expect(b).toBe(5)});it("reads the 'data-slider-step' property and sets it on slider",function(){a=$("#stepSlider").slider();expect(true).toBeTruthy()});it("reads the 'data-slider-precision' property (which is set to 2) and sets it on slider",function(){a=$("#precisionSlider").slider();a.slider("setValue",8.115);var b=a.slider("getValue");expect(b).toBe(8.12)});it("reads the 'data-slider-orientation' property and sets it on slider",function(){a=$("#orientationSlider").slider();var b=$("#orientationSlider").data("slider").options.orientation==="vertical";expect(b).toBeTruthy()});it("reads the 'data-slider-value' property and sets it on slider",function(){a=$("#valueSlider").slider();var b=a.slider("getValue");expect(b).toBe(5)});it("reads the 'data-slider-ticks-labels' property and sets it on slider",function(){a=$("#sliderWithTickMarksAndLabels").slider();var c=b($("#sliderWithTickMarksAndLabels").data("slider").options.ticks_labels,["$0","$100","$200","$300","$400"]);expect(c).toBeTruthy();function b(e,d){if(e===d){return true}if(e==null||d==null){return false}if(e.length!==d.length){return false}for(var f=0;f<e.length;++f){if(e[f]!==d[f]){return false}}return true}});it("reads the 'data-slider-selection' property and sets it on slider",function(){a=$("#selectionSlider").slider({id:"selectionSliderId"});a.slider("setValue",0);var b=a.slider("getValue");expect(b).toBe(0)});it("reads the 'data-slider-tooltip' property and sets it on slider",function(){a=$("#tooltipSlider").slider({id:"tooltipSliderElem"});var b=$("#tooltipSliderElem").children("div.tooltip").hasClass("hide");expect(b).toBeTruthy()});describe("reads the 'data-slider-handle' property and sets it on slider",function(){it("applies 'triangle' class tag to handle",function(){a=$("#handleSlider").slider({id:"handleSliderElem"});var b=$("#handleSliderElem div.slider-track").children("div.slider-handle").hasClass("triangle");expect(b).toBeTruthy()});it("applies 'custom' class tag to handle",function(){a=$("#customHandleSlider").slider({id:"customHandleSliderElem"});var b=$("#customHandleSliderElem div.slider-track").children("div.slider-handle").hasClass("custom");expect(b).toBeTruthy()})});it("reads the 'data-slider-reversed' property and sets it on slider",function(){a=$("#reversedSlider").slider({id:"reversedSliderElem"});a.slider("setValue",10);var b=$("#reversedSliderElem div.slider-track").children("div.slider-selection").width();expect(b).toBe(0)});it("reads the 'data-slider-enabled' property and sets it on slider",function(){a=$("#disabledSlider").slider();var b=a.slider("isEnabled");expect(b).not.toBeTruthy()});it("always sets the 'value' attribute of the original <input> element to be the current slider value",function(){var e=$("#testSliderGeneric");var d=7;a=e.slider({value:d});var b=e.val();var c=d.toString();expect(b).toBe(c)});it("always sets the 'data-value' attribute of the original <input> element to be the current slider value",function(){var b=document.getElementById("testSliderGeneric");var c=7;a=new Slider(b,{value:c});expect(b.dataset.value).toBe(c.toString());a.destroy();a=null});afterEach(function(){if(a){a.slider("destroy")}})});